import React from "react";
import Header from "./Components/Header";
// import Image from "./Components/Image";
import logo from "./img/logo.png";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      helpText: "help me",
      userData: "",
      whatsNew: "",
    };

    this.inputClick = this.inputClick.bind(this);
  }

  render() {
    return (
      <div className="name">
        <Header title="look at me" name="opps" />
        <Header title="look at her" />
        <Header title="look at him" />
        <h1>{this.state.helpText}</h1>
        <h2>{this.state.userData}</h2>
        <h3>{this.state.whatsNew}</h3>
        <input
          placeholder={this.state.helpText}
          onChange={(event) => this.setState({ userData: event.target.value })}
          onChange={(event) => this.setState({ whatsNew: event.target.value })}
          onClick={this.inputClick}
          onMouseEnter={this.mouseOver}
        />
        <p>{this.state.helpText === "help me" ? "ok" : "no"}</p>

        <img src={logo} className="ttt" alt="apple" />
      </div>
    );
  }

  inputClick() {
    this.setState({ helpText: "changed" });
    console.log("clicked");
  }
  mouseOver() {
    console.log("over mouse");
  }
}

export default App;
